import React, {Component} from 'react';
import {Link} from 'react-router-dom';


class HeaderComponent extends Component {


    render () {
        return (
            <header>
                <nav>
                    <ul>
                        <li><Link to="/login">Login</Link></li>
                        <li><Link to="/logout">Logout</Link></li>
                    </ul>
                </nav>
            </header>
        )
    }
}
